header.script:
function Search_Submit() {
    if (document.getElementById('txtSearch').value != '') {
        var searchType = '0';
        if (searchType == 0) {
            window.location.href = '/product.aspx?q=' + encodeURI(document.getElementById('txtSearch').value) + '&type=0';
        }
        else {
            window.location.href = '/article.aspx?q=' + encodeURI(document.getElementById('txtSearch').value) + '&type=1';
        }
    }
    else {
        alert('请输入关键字');
    }
}

body.script:
function mShare() {
    $("#mShareBox").toggle();
    $("#serviceBox").hide();
}

if ($(".banner .slider__wrapper li").length == 0) {
    $(".banner").addClass("emptyBanner");
}

function showService() {
    $("#mShareBox").hide();
    $("#serviceBox").toggle();
}
